import Navbar from "../components/Navbar";
import Footer from "../components/Footer";
import UserContext from "./Data";

import { useContext } from "react";

function ContactUs(){

    let {user, setUser} = useContext(UserContext);
    return(
        <div>
            <h1 class="text-center">Need help or <br/> wants to stay connected {user}?</h1>

            <form className="align-middle">
                <div class="mb-3 row text-center align-middle">
                    <div class="col-sm-2">
                        <input type="text" className="form-control" id="inputName" placeholder="Name" style={{color:"red"}}/>
                        <br/>
                        <input type="email" className="form-control" id="inputEmail" placeholder="Email"/>
                        <br/>
                        <textarea type="text" className="form-control" id="inputEmail" placeholder="Your message here..."/>
                        <br/>
                        <input className="btn btn-primary" type="submit" value="Submit"></input>
                    </div>
                </div>
            </form>


            <Footer/>
        </div>
    )
}

export default ContactUs;
